import './Menu.css'

function Menu(){
    return(
        <div className='sidebar'>
            <ul>
                <li>Home</li>
                <li>Team</li>
                <li>Projects</li>
                <li>Calender</li>
                <li>Documents</li>
            </ul>

        </div>
    )
}
export default Menu;
